  false,\n\t\"url\": null,\n\t\"notes\": \"This Parcels and Land Ownership dataset,
  was produced all or in part from Published Reports/Deeds information as of 2007.
  It is described as 'Parcel boundaries for Johnson County Kansas based off of legal
  description. Used to show spatial reference to parcel boundaries of Johnson County
  Kansas.'. This data set includes internal links to Building Permit data. This data
  set includes internal links to Assessment/CAMA data. Key attributes of this data
  set include (but are not limited to): Deeded Acreage,Building Value,Land Use Code,Land
  Value,Number of Structures,Owner Address,Parcel Address,Parcel Owner,Total Value,Type
  of Ownership,Zoning Data by this publisher are often provided in State Plane coordinate
  system; in a Lambert Conformal-conic projection; The extent of these data is generally
  Johnson County, KS,Fairway, KS,Lake Quivira, KS,Leawood, KS,Lenexa, KS,Merriam,
  KS,Mission, KS,Mission Hills, KS,Mission Woods, KS,Prairie Village, KS,Roeland Park,
